function FastButton(e,t){this.element=e;this.handler=t;e.addEventListener("touchstart",this,false)}function preventGhostClick(e,t){coordinates.push(e,t);window.setTimeout(gpop,2500)}function gpop(){coordinates.splice(0,2)}function gonClick(e){for(var t=0;t<coordinates.length;t+=2){var n=coordinates[t];var r=coordinates[t+1];if(Math.abs(e.clientX-n)<25&&Math.abs(e.clientY-r)<25){e.stopPropagation();e.preventDefault()}}}function initFastButtons(){new FastButton(document.getElementById("fastclick"),goSomewhere)}function goSomewhere(){var e=document.elementFromPoint(this.startX,this.startY);if(e.nodeType==3)e=e.parentNode;var t=document.createEvent("MouseEvents");t.initEvent("click",true,true);e.dispatchEvent(t)}FastButton.prototype.handleEvent=function(e){switch(e.type){case"touchstart":this.onTouchStart(e);break;case"touchmove":this.onTouchMove(e);break;case"touchend":this.onClick(e);break;case"click":this.onClick(e);break}};FastButton.prototype.onTouchStart=function(e){e.stopPropagation();this.element.addEventListener("touchend",this,false);document.body.addEventListener("touchmove",this,false);this.startX=e.touches[0].clientX;this.startY=e.touches[0].clientY;isMoving=false};FastButton.prototype.onTouchMove=function(e){if(Math.abs(e.touches[0].clientX-this.startX)>10||Math.abs(e.touches[0].clientY-this.startY)>10){this.reset()}};FastButton.prototype.onClick=function(e){this.reset();this.handler(e);if(e.type=="touchend"){preventGhostClick(this.startX,this.startY)}};FastButton.prototype.reset=function(){this.element.removeEventListener("touchend",this,false);document.body.removeEventListener("touchmove",this,false)};document.addEventListener("click",gonClick,true);var coordinates=[];